def emg_analysis(buffer,data_everychannel):
    channel, i, j, data_channel, emg_channel, res_emg,width= 4, 0, 4, '', 0, [], 32  
    while (channel):
        while (j):
            # print(len(buffer))

            # print(buffer[i:i + 2])
            
            data_channel = buffer[i:i + 2] + data_channel
            # print(data_channel)
            # print(type(data_channel))
            i, j = i + 2, j - 1
        # emg_channel = int(data_channel, 16)
        # 补码
        emg_channel =int(data_channel, 16)
        # print(channel)
        # print("补码前。。。")
        # print(emg_channel)
        if emg_channel  > 2 ** (width-1)- 1:
                emg_channel  = 2 ** width-emg_channel 
                emg_channel =0-emg_channel

        # print("补码后。。。")
        # print(emg_channel)
        
        data_everychannel[channel-1].append(emg_channel/24)
        res_emg.append(emg_channel)
        channel = channel - 1
        j, data_channel = 4, ''
    return res_emg,data_everychannel
    


def get_rms(records):
    """
    均方根值
    """
    # print(records)
    if records==[]:
        # print("无可用通道")
        return 0
    sum=0
    # print("有可用通道")
    for i in range(len(records)):
        sum+=records[i]*records[i]
    return math.sqrt(sum/ len(records))

