def filter_Notch(data):
    c, d=signal.butter(4,[0.098,0.1],'stop')
    filtered_data= signal.filtfilt(c, d, data,axis=0)
    return filtered_data
def filtered_bp(data):
    c, d = signal.butter(4, [0.04,0.9], 'bandpass')   #配置滤波器 8 表示滤波器的阶数
    filtered_data = signal.filtfilt(c, d, data,axis=0)  #data为要过滤的信号
    return filtered_data
def filter_Notch2(fs,f0,Q,data):
    # fs = 200.0  # Sample frequency (Hz)

    # f0 = 60.0  # Frequency to be removed from signal (Hz)

    # Q = 30.0  # Quality factor

    # Design notch filter

    b, a = signal.iirnotch(f0, Q, fs)
    filtered_data= signal.filtfilt(b, a, data,axis=0)
    return filtered_data    
